void GroundStrafe(struct usercmd_s* cmd)
{
	
	if (!g_Local.Death)
	{
		if (GetAsyncKeyState(g_Key.GroundStrafeKey))
		{
			if (!GS_Stay)
			{
				g_Engine.pfnClientCmd(XorString("fps_max 1000"));
				GS_Stay = true;
			}
			static int gs_state = 0;
			if (g_Local.ppmove->flFallVelocity > 0)
			{
				if (g_Vars.AdjustSpeed && (g_Local.flGroundAngle < 5) && (g_Local.flHeight <= 0.000001f || g_Local.ppmove->flags & FL_ONGROUND)) { AdjustSpeed((double)0.0001); }

				if (g_Local.ppmove->flFallVelocity >= 140)
					if (g_Local.flHeight <= 30)
						if (GetAsyncKeyState(17))
							cmd->buttons |= IN_DUCK;
			}
			if (gs_state == 0 && (g_Local.ppmove->flags & FL_ONGROUND))
			{
				if (g_Vars.AdjustSpeed && (g_Local.flGroundAngle < 5) && (g_Local.flHeight <= 0.000001f || g_Local.ppmove->flags & FL_ONGROUND)) { AdjustSpeed((double)0.0001); }
				cmd->buttons |= IN_DUCK;
				gs_state = 1;
			}
			else if (gs_state == 1)
			{
				if (((g_Local.ppmove->flags & FL_DUCKING) ? 1 : 0) == 0)
					if (g_Vars.AdjustSpeed && (g_Local.flGroundAngle < 5) && (g_Local.flHeight <= 0.000001f || g_Local.ppmove->flags & FL_ONGROUND)) { AdjustSpeed((double)0.0001); }
				if (g_Local.ppmove->usehull == 0) { cmd->buttons |= IN_JUMP; }
				cmd->buttons &= ~IN_DUCK;
				gs_state = 0;
			}
		}
		else
		{
			if (GS_Stay)
			{
				g_Engine.pfnClientCmd(XorString("fps_modem 0;fps_max 100"));
				GS_Stay = false;
			}
		}
	}
	else
	{
		if (GS_Stay)
		{
			g_Engine.pfnClientCmd(XorString("fps_modem 0;fps_max 100"));
			GS_Stay = false;
		}
	}
	
}

