void AutoDir(struct usercmd_s* cmd)
{
	
	if (cmd->buttons & IN_MOVERIGHT)
		strafe_dir = 2;
	else if (cmd->buttons & IN_BACK)
		strafe_dir = 3;
	else if (cmd->buttons & IN_MOVELEFT)
		strafe_dir = 4;
	else
		strafe_dir = 1;
	
}

