void ThirdPerson(struct ref_params_s* pparams)
{
	if (g_Vars.ThirdPerson)
	{
		Vector Offset(0, 0, 0);
		Vector r, u, b;
		VectorMul(pparams->right, g_Vars.CameraOffset_right, r);
		VectorMul(pparams->up, g_Vars.CameraOffset_up, u);
		VectorMul(pparams->forward, -g_Vars.CameraOffset_forward, b);
		Offset = Offset + r;
		Offset = Offset + u;
		Offset = Offset + b;
		pparams->vieworg[0] += Offset[0];
		pparams->vieworg[1] += Offset[1];
		pparams->vieworg[2] += Offset[2];
	}
}

float YawForVec(float* fwd)
{
	if (fwd[1] == 0 && fwd[0] == 0)
	{
		return 0;
	}
	else
	{
		float yaw = (atan2(fwd[1], fwd[0]) * 180 / M_PI);
		if (yaw < 0)
			yaw += 360;
		return yaw;
	}
}
